import React from 'react';
import { Route, Routes } from 'react-router-dom';
import './App.css';
import PageLayout from './_layout/pageLayout';
import CookingBookDataService from './_pages/_cookingBook/CookingBookDataService'
import ViewMenuDataService from './_pages/_cookingBook/ViewMenuDataService';


const App: React.FC = () =>{

  return(
    <PageLayout>
      <Routes>
        <Route path="/" element={<div>Test</div>}/>
        <Route path="/cookingbook/view" element={<ViewMenuDataService />}/>
        <Route path="/cookingbook/add" element={<CookingBookDataService componentKey='add'/>}/>
        <Route path="/cookingbook/edit" element={<CookingBookDataService componentKey='edit'/>}/>
      </Routes>
    </PageLayout>
  )
}

export default App;
